INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 2, 2.46, 1, 12300150, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 1, 3001, 2, "vo_minigame_1012_result_1082", 5, 3, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 2, 2.94, 1, 12300151, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 1, 3001, 2, "vo_minigame_1012_result_1083", 5, 3, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 3, 4.19, 1, 12300152, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 1, 3001, 2, "vo_minigame_1012_result_1084", 5, 7, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 3, 0.0, 1, 12300153, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 1, 3001, 2, "vo_minigame_1012_result_1085", 5, 1, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 3, 2.63, 1, 12300154, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 1, 3001, 2, "vo_minigame_1012_result_1086", 5, 3, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 1, 5.53, 1, 12300155, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, 3001, 2, "vo_minigame_1012_result_1087", 1, 3, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 1, 0.01, 1, 12300156, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 3, 3001, 2, "vo_minigame_1012_result_1088", 1, 3, 9);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 1, 4.15, 1, 12300157, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1, 3001, 2, "vo_minigame_1012_result_1089", 1, 3, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 2, 0.01, 1, 12300158, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 9, 3001, 2, "vo_minigame_1012_result_1090", 1, 9, 9);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 2, 5.37, 1, 12300159, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 1, 3001, 2, "vo_minigame_1012_result_1091", 1, 3, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 2, 1.44, 1, 12300160, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1, 3001, 2, "vo_minigame_1012_result_1092", 1, 3, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 3, 0.0, 1, 12300161, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3, 3001, 2, "vo_minigame_1012_result_1093", 1, 3, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 3, 2.91, 1, 12300162, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 9, 3001, 2, "vo_minigame_1012_result_1094", 1, 3, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 3, 2.61, 1, 12300163, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 1, 3001, 2, "vo_minigame_1012_result_1095", 1, 5, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 1, 3.63, 1, 12300164, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 2, 3001, 2, "vo_minigame_1012_result_1096", 0, 4, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 1, 4.16, 1, 12300165, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 2, 3001, 2, "vo_minigame_1012_result_1097", 0, 6, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 1, 0.01, 1, 12300166, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 3, 3001, 2, "vo_minigame_1012_result_1098", 0, 3, 6);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 2, 5.75, 1, 12300167, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 2, 3001, 2, "vo_minigame_1012_result_1099", 0, 6, 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 2, 5.64, 1, 12300168, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 2, 3001, 2, "vo_minigame_1012_result_1100", 0, 4, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 2, 5.73, 1, 12300169, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 4, 3001, 2, "vo_minigame_1012_result_1101", 0, 8, 8);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 3, 5.32, 1, 12300170, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 3, 3001, 2, "vo_minigame_1012_result_1102", 0, 5, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 3, 2.37, 1, 12300171, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 9, 3001, 2, "vo_minigame_1012_result_1103", 0, 3, 9);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 3, 4.25, 1, 12300172, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 1, 3001, 2, "vo_minigame_1012_result_1104", 0, 9, 3);
